from django.db import modelsfrom apps.account.models import AccountCONSULT_TYPE = (    ("unknown", "unknown"),)class Consulting(models.Model):    name = models.CharField(max_length=255)    price = models.IntegerField()    rel_doctor = models.ForeignKey(Account, on_delete=models.CASCADE, related_name="consult_rel_doctor")    comments = models.TextField()    doctor = models.ForeignKey(Account, on_delete=models.CASCADE, related_name="consults")    stage = models.IntegerField()    # type = models.CharField(max_length=255, choices=CONSULT_TYPE, null=True)    created_by = models.ForeignKey(Account, related_name="consult", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_consult", on_delete=models.SET_NULL, null=True)    def __str__(self):        return self.name